export default {
	users : [],
	async updateTableUsers () {
		this.users = await select_users.run();
	},
	async init () {
		if (!appsmith.store.user) {
			navigateTo('Login');
		}
		if (!appsmith.store.user.superuser) {
			navigateTo('Home');
		}
		await this.updateTableUsers();
	},
	async onRowSelected () {
		Input_username.setValue(Table_users.selectedRow.username);
		Input_email.setValue(Table_users.selectedRow.email);
		Switch_superuser.setValue(Table_users.selectedRow.superuser);
		Switch_staff.setValue(Table_users.selectedRow.staff);
		Switch_enable.setValue(Table_users.selectedRow.enable);
	},
	async createUser (username, password1, password2, email, superuser, staff, enable) {
		if (!username) {
			showAlert("ユーザー名を入力して下さい", 'error');
			return;
		}

		if (!password1 || !password2) {
			showAlert("パスワードを入力して下さい", 'error');
			return;
		}

		let password = null; // hashed password.
	  if (password1 === password2) {
			password = await dcodeIO.bcrypt.hash(password1, 8);
		} else {
			showAlert("パスワードが一致しません", 'error');
			return;
		}

		// create
		await insert_user.run({
			'username': username,
			'password': password,
			'email': email,
			'superuser': superuser,
			'staff': staff,
			'enable': enable
		});

		this.updateTableUsers();
	},
	async deleteUser (userid) {
		await delete_user.run({'id': userid});
		await this.updateTableUsers();
	},
	async updateUser (userid, username, password1, password2, email, superuser, staff, enable) {
		if (!userid) {
			showAlert('更新対象ユーザーを選択して下さい', 'error');
			return;
		}

		let password = null; // hashed password.
		if (password1 && password2) {
			if (password1 === password2) {
				password = await dcodeIO.bcrypt.hash(password1, 8);
			} else {
				showAlert("パスワードが一致しません", 'error');
				return;
			}
		}

		if (password) {
			await update_user.run({
				'id':userid,
				'username': username,
				'password': password,
				'email': email,
				'superuser': superuser,
				'staff': staff,
				'enable': enable
			});
		} else {
			await update_user_without_password.run({
				'id':userid,
				'username': username,
				'email': email,
				'superuser': superuser,
				'staff': staff,
				'enable': enable
			});
		}

		this.updateTableUsers();
	}
}

